import React from "react";
import {useState}  from 'react';


function Paginate(page, setPage) {
    const [input,setInput] = useState(1)

    function nextPage(){
        setInput(input + 1);
        setPage(page + 1);
    };

    function previusPage(){
        setInput(input - 1);
        setPage(page - 1);
    };


        
    return (
        <div>
            <button onClick={previusPage}>
                Previus
            </button>

            <input name='page' autoComplete='off' value={input} />
            <p> of {Math.ceil(page.max)}</p>

            <button onClick={nextPage}>
                Next
            </button>
        </div>
    )
}



export default Paginate
